Personnel who perform work roles to support or facilitate the functions of cyber-IT, cybersecurity, cyberspace effects, or intelligence workforce (cyberspace) work roles. This includes actions to support acquisition, training and leadership activities.' CREATED='1756820829922' ID='ID_mf2lrg0ybcm0uus8p5e' MODIFIED='1756820829922' POSITION='right'><depth>1</depth><icon/><image/><imageSize/><node TEXT='OVERSIGHT and GOVERNANCE (OG) – Provides leadership, management, direction, and advocacy so the organization may effectively manage cybersecurity-related risks to the enterprise and conduct cybersecurity work. ' CREATED='1756820829922' ID='ID_mf2lrg0yyqmse2r337j' MODIFIED='1756820829922'><depth>2</depth><icon/><image/><imageSize/><node TEXT='Training / Education' CREATED='1756820829922' ID='ID_mf2lrg0ycsqcu5iqedp' MODIFIED='1756820829922'><depth>3</depth><icon/><image/><imageSize/><node TEXT='(711) (OG-WRL-004) Cyber Instructional Curriculum Developer
